import './App.css';
import { BrowserRouter as Router, Route, Link, Switch } from 'react-router-dom';


import LoginPage from './Components/LoginPage';

function App() {
  return (
    <div className="App">
      <title>Plot N' Plant</title>
      <LoginPage />
      <Router>
      <Switch>
        <Route path="/register">
          <RegisterPage />
        </Route>
        <Route path="/login">
          <LoginPage />
        </Route>
      </Switch>
    </Router>
    </div>
  );
}

export default App;
